import { Autocomplete, Chip, InputAdornment, TextField } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import React from "react";

const SearchBar = ({ sx }) => {
	return (
		<Autocomplete
			multiple
			freeSolo
			limitTags={2}
			id='tags-standard'
			options={top100Films.map((option) => option.title)}
			sx={{ flexGrow: 1, ...sx }}
			renderTags={(value, getTagProps) =>
				value.map((option, index) => (
					<Chip
						variant='outlined'
						label={option}
						size='medium'
						{...getTagProps({ index })}
						sx={{
							borderRadius: "10px",
							color: "primary.main",
							borderColor: "#482fd740",
						}}
					/>
				))
			}
			renderInput={(params) => {
				return (
					<TextField
						{...params}
						placeholder={params.inputProps.value ? "Favorites" : ""}
						hiddenLabel
						fullWidth
						InputProps={{
							...params.InputProps,
							startAdornment: (
								<>
									<InputAdornment position='start'>
										<SearchIcon sx={{ color: "primary.main" }} />
									</InputAdornment>
									{params.InputProps.startAdornment}
								</>
							),
							style: {
								borderRadius: "15px",
								borderColor: "white",
								boxShadow: "0px 8px 20px 0px #0000001A",
							},
						}}
						sx={{
							padding: "5px",
						}}
					/>
				);
			}}
		/>
	);
};

const top100Films = [];

export default SearchBar;
